Defendant in custody.   
Defendant is before the Court for sentencing, her probation having been revoked effective 07-03-17.   
Defendant is sentenced to the Wisconsin State Prison System for a total sentence of six (6) years.   Three (3) years initial confinement, followed by three (3) years extended supervision.  Conditions of extended supervision are:
1) Pay costs of action; 
2) Pay supervision fees in an amount to be determined by DOC; 
3) AODA assessment and follow through; 
4) Submit to random urine screens and pay for same; 
5) Assessment/treatment/counseling as deemed appropriate by the Department's assessment process; 
6) Full-time employment/schooling or combination as deemed appropriate by the agent, after assessment, due to defendant's disability; 
7) Reimburse buy money of $260.00 to Metro Drug Unit.  
Defendant is given credit for 196 days already served.   
Court finds the defendant is not eligible for the Challenge Incarceration Program buy is eligible for the Substance Abuse Program.   
Minutes.

State moves to delete the penalty enhancer on count 1, within 1,000 feet of park.  Motion granted.   
Count 1 - Deliver Heroin - No contest plea.  Convicted.   State moves to dismiss and read in counts 2 - 6.  Motion granted.   Sentence is withheld.  Defendant is placed on probation to DOC for three (3) years.  Conditions of probation:
1) AODA assessment and follow through;
2) Submit to random urine screens and pay for same;
3) Assessment/treatment/counseling as deemed appropriate by the Department's assessment process;
4) Spend four (4) months in the Manitowoc County Jail, under the Huber Law, to commence on 07-07-15 by 6:00 p.m.  A one day furlough every 29 days is granted, if determined this is necessary for the defendant to stay eligible for SSI;
5) Pay costs of action;
6) Full-time employment/school or combination, as deemed appropriate by the agent, after assessment, due to the defendant's disability;
7) Reimburse buy money of $260.00 to Metro Drug Unit;
8) Submit to DNA sample and pay the costs;
9) Pay supervision fees in an amount to be determined by DOC.
